const color = {
  primary: "rgb(89,56,37)",
  white: "white",
}

const typography = {
  title: {
    color: 'rgb(89,56,37)',
    fontFamily: 'Philosopher',
    fontSize: '3rem',
  },
  navMenu: {
    color: 'rgb(89,56,37)'
  },
  heading: {
    'fontFamily': 'Philosopher',
    'fontSizing': '1rem',
    'color': 'rgb(89,56,37)',
  },
  paragraph: {
    'fontFamily': 'sans-serif',
    'fontSizing': '0.5rem'
  }
}

const theme = {
  color,
  typography,
}

export default theme;
